instance.Javadoc:
* Constructs Faker instance with provided {@link Locale} and {@link Random}.
     *
     * @param locale - {@link Locale}
     * @param random - {@link Random}
     * @return {@link BaseFaker#BaseFaker(Locale, Random)}
     * @deprecated Use the constructor with locale and random instead

fullName.Javadoc:
* Returns the same value as {@link #name()}
     *
     * @see Name#name()

resolve.Javadoc:
* Resolves a key to a method on an object or throws an exception with specified message.
     * <p>
     * #{hello} with result in a method call to current.hello();
     * <p>
     * #{Person.hello_someone} will result in a method call to person.helloSomeone();
